content:
Design the basic function of **Excel** and implement the function of the sum formula._x000D_
_x000D_
Implement the `Excel` class:_x000D_
_x000D_
*   `Excel(int height, char width)` Initializes the object with the `height` and the `width` of the sheet. The sheet is an integer matrix `mat` of size `height x width` with the row index in the range `[1, height]` and the column index in the range `['A', width]`. All the values should be **zero** initially._x000D_
*   `void set(int row, char column, int val)` Changes the value at `mat[row][column]` to be `val`._x000D_
*   `int get(int row, char column)` Returns the value at `mat[row][column]`._x000D_
*   `int sum(int row, char column, List numbers)` Sets the value at `mat[row][column]` to be the sum of cells represented by `numbers` and returns the value at `mat[row][column]`. This sum formula **should exist** until this cell is overlapped by another value or another sum formula. `numbers[i]` could be on the format:_x000D_
    *   `"ColRow "` that represents a single cell._x000D_
        *   For example, `"F7 "` represents the cell `mat[7]['F']`._x000D_
    *   `"ColRow1:ColRow2 "` that represents a range of cells. The range will always be a rectangle where `"ColRow1 "` represent the position of the top-left cell, and `"ColRow2 "` represents the position of the bottom-right cell._x000D_
        *   For example, `"B3:F7 "` represents the cells `mat[i][j]` for `3 <= i <= 7` and `'B' <= j <= 'F'`._x000D_
_x000D_
**Note:** You could assume that there will not be any circular sum reference._x000D_
_x000D_
*   For example, `mat[1]['A'] == sum(1, "B ")` and `mat[1]['B'] == sum(1, "A ")`._x000D_
_x000D_
**Example 1:**_x000D_
_x000D_
**Input**_x000D_
\[ "Excel ",  "set ",  "sum ",  "set ",  "get "\]_x000D_
\[\[3,  "C "\], \[1,  "A ", 2\], \[3,  "C ", \[ "A1 ",  "A1:B2 "\]\], \[2,  "B ", 2\], \[3,  "C "\]\]_x000D_
**Output**_x000D_
\[null, null, 4, null, 6\]_x000D_
_x000D_
**Explanation**_x000D_
Excel excel = new Excel(3,  "C ");_x000D_
 // construct a 3\*3 2D array with all zero._x000D_
 //   A B C_x000D_
 // 1 0 0 0_x000D_
 // 2 0 0 0_x000D_
 // 3 0 0 0_x000D_
excel.set(1,  "A ", 2);_x000D_
 // set mat\[1\]\[ "A "\] to be 2._x000D_
 //   A B C_x000D_
 // 1 2 0 0_x000D_
 // 2 0 0 0_x000D_
 // 3 0 0 0_x000D_
excel.sum(3,  "C ", \[ "A1 ",  "A1:B2 "\]); // return 4_x000D_
 // set mat\[3\]\[ "C "\] to be the sum of value at mat\[1\]\[ "A "\] and the values sum of the rectangle range whose top-left cell is mat\[1\]\[ "A "\] and bottom-right cell is mat\[2\]\[ "B "\]._x000D_
 //   A B C_x000D_
 // 1 2 0 0_x000D_
 // 2 0 0 0_x000D_
 // 3 0 0 4_x000D_
excel.set(2,  "B ", 2);_x000D_
 // set mat\[2\]\[ "B "\] to be 2. Note mat\[3\]\[ "C "\] should also be changed._x000D_
 //   A B C_x000D_
 // 1 2 0 0_x000D_
 // 2 0 2 0_x000D_
 // 3 0 0 6_x000D_
excel.get(3,  "C "); // return 6_x000D_
_x000D_
**Constraints:**_x000D_
_x000D_
*   `1 <= height <= 26`_x000D_
*   `'A' <= width <= 'Z'`_x000D_
*   `1 <= row <= height`_x000D_
*   `'A' <= column <= width`_x000D_
*   `-100 <= val <= 100`_x000D_
*   `1 <= numbers.length <= 5`_x000D_
*   `numbers[i]` has the format `"ColRow "` or `"ColRow1:ColRow2 "`._x000D_
*   At most `100` calls will be made to `set`, `get`, and `sum`.
